import nltk
import re
import numpy as np

from nltk.stem import WordNetLemmatizer

from sklearn.preprocessing import normalize


from scipy.sparse import csr_matrix, spdiags, hstack, csr_array

nltk.download('wordnet')
lemmatizer = WordNetLemmatizer()

TAGS = dict()
for word in VERB:
    TAGS[word] = "v"
    
for word in NOUN:
    if word in TAGS:
        TAGS[word] += "n"
    else:
        TAGS[word] = "n"

for word in ADJ:
    if word in TAGS:
        TAGS[word] += "a"
    else:
        TAGS[word] = "a"

for word in STOP:
    if word in TAGS:
        TAGS[word] += "s"
    else:
        TAGS[word] = "s"

for word in QUESTION:
    if word in TAGS:
        TAGS[word] += "q"
    else:
        TAGS[word] = "q"


tagger = nltk.tag.UnigramTagger(model=TAGS, backoff=nltk.DefaultTagger('x'))

word_action = dict()
for word in NEG:
    word_action[word] = 0
for word in PRE_BOOST:
    word_action[word] = 1
for word in FINAL_BOOST:
    word_action[word] = 2
for word in PRE_DECREASE:
    word_action[word] = 3
for word in FINAL_DECREASE:
    word_action[word] = 4

grammar_tag = (r"""
  QUESTION: {^<.*q.*><.*v.*><.*s.*>?<.*a.*>*<.*n.*>}
  QUESTION2: {^<.*q.*><.*s.*>?<.*a.*>*<.*n.*><.*v.*>}
  TASK: {<.*v.*><.*s.*>?<.*a.*>*<.*n.*>}
""")
chunking_tag = nltk.RegexpParser(grammar_tag)

def to_tree(paragraph):
    sent_list = [list(map(lemmatizer.lemmatize, word_list)) for word_list in list(map(nltk.word_tokenize, nltk.sent_tokenize(paragraph.lower())))]
    return nltk.tree.Tree("PARAGRAPH", list(map(chunking_tag.parse, map(tagger.tag, sent_list))))

def parse_sentence(sentence):
    ans = []
    for line in sentence:
        if isinstance(line, nltk.tree.Tree):
            label = line.label()
            weight = 1.0
            negate = False

            if label == "TASK" or label == "QUESTION":
                for word, tag in line[1:-1]:
                    if "a" in tag and word in word_action:
                        action = word_action[word]
                        if action == 0:
                            negate = not negate

                        elif action == 1:
                            weight += (-0.15 if (weight < 0) != negate else 0.15)

                        elif action == 2:
                            weight *= 1.35
                            if negate:
                                weight = 1.0 / weight

                        elif action == 3:
                            weight += (0.15 if (weight < 0) != negate else -0.15)

                        else:
                            weight *= 1.35
                            if not negate:
                                weight = 1.0 / weight
                        
                        if action != 0:
                            negate = False
                ans.append((line[0][0], line[-1][0], weight))

            if label == "QUESTION2":
                for word, tag in line[1:-2]:
                    if "a" in tag and word in word_action:
                        action = word_action[word]
                        if action == 0:
                            negate = not negate

                        elif action == 1:
                            weight += (-0.15 if (weight < 0) != negate else 0.15)

                        elif action == 2:
                            weight *= 1.35
                            if negate:
                                weight = 1.0 / weight

                        elif action == 3:
                            weight += (0.15 if (weight < 0) != negate else -0.15)

                        else:
                            weight *= 1.35
                            if not negate:
                                weight = 1.0 / weight
                        
                        if action != 0:
                            negate = False
                
                ans.append((line[0][0], line[-2][0], weight))
            
    return ans

illegal_chars_re = re.compile("[\{\}\"\'\[\]\(\)]*")
def get_paragraph_tree(paragraph):
    return to_tree(paragraph=illegal_chars_re.sub('', paragraph))

def count_paragraphs(paragraphs, vocabulary_verbs, vocabulary_nouns, vocabulary_pairs):
    j_indices_verbs = []
    j_indices_nouns = []
    j_indices_pairs = []
    indptr_verbs = [0]
    indptr_nouns = [0]
    indptr_pairs = [0]
    values_verbs = []
    values_nouns = []
    values_pairs = []

    vocabulary_verbs_dict = dict()
    for i, word in enumerate(vocabulary_verbs):
        vocabulary_verbs_dict[word] = i
    
    vocabulary_nouns_dict = dict()
    for i, word in enumerate(vocabulary_nouns):
        vocabulary_nouns_dict[word] = i

    vocabulary_pairs_dict = dict()
    for i, word in enumerate(vocabulary_pairs):
        vocabulary_pairs_dict[word] = i
    
    for i, paragraph in enumerate(paragraphs):
        verbs_found = {}
        nouns_found = {}
        pairs_found = {}

        for sentence_nr, sentence in enumerate(paragraph):
            pairs = parse_sentence(sentence=sentence)
            sentence_weight = 2*abs(1 + sentence_nr - len(paragraph)/2)/len(paragraph)
            sentence_weight = sentence_weight * sentence_weight + 1
            for j, pair in enumerate(pairs):
                pair_new = pair[0]+","+pair[1]
                if pair_new in vocabulary_pairs_dict:
                    idx = vocabulary_pairs_dict[pair_new]
                    if idx in pairs_found:
                        pairs_found[idx] += sentence_weight * pair[2]
                    else:
                        pairs_found[idx] = sentence_weight * pair[2]

                if pair[0] in vocabulary_verbs_dict:
                    idx = vocabulary_verbs_dict[pair[0]]
                    if idx in verbs_found:
                        verbs_found[idx] += sentence_weight * pair[2]
                    else:
                        verbs_found[idx] = sentence_weight * pair[2]

                if pair[1] in vocabulary_nouns_dict:
                    idx = vocabulary_nouns_dict[pair[1]]
                    if idx in nouns_found:
                        nouns_found[idx] += sentence_weight * pair[2]
                    else:
                        nouns_found[idx] = sentence_weight * pair[2]
            
        j_indices_verbs.extend(verbs_found.keys())
        values_verbs.extend(verbs_found.values())
        indptr_verbs.append(len(j_indices_verbs))

        j_indices_nouns.extend(nouns_found.keys())
        values_nouns.extend(nouns_found.values())
        indptr_nouns.append(len(j_indices_nouns))

        j_indices_pairs.extend(pairs_found.keys())
        values_pairs.extend(pairs_found.values())
        indptr_pairs.append(len(j_indices_pairs))
    
    j_indices_verbs = np.asarray(j_indices_verbs, dtype=np.int64)
    indptr_verbs = np.asarray(indptr_verbs, dtype=np.int64)
    values_verbs = np.asarray(values_verbs, dtype=float)

    result_verbs = csr_matrix(
        (values_verbs, j_indices_verbs, indptr_verbs),
        shape=(len(indptr_verbs) - 1, len(vocabulary_verbs)),
        dtype=float,
    )
    result_verbs.sort_indices()
        
    j_indices_nouns = np.asarray(j_indices_nouns, dtype=np.int64)
    indptr_nouns = np.asarray(indptr_nouns, dtype=np.int64)
    values_nouns = np.asarray(values_nouns, dtype=float)

    result_nouns = csr_matrix(
        (values_nouns, j_indices_nouns, indptr_nouns),
        shape=(len(indptr_nouns) - 1, len(vocabulary_nouns)),
        dtype=float,
    )
    result_nouns.sort_indices()

    j_indices_pairs = np.asarray(j_indices_pairs, dtype=np.int64)
    indptr_pairs = np.asarray(indptr_pairs, dtype=np.int64)
    values_pairs = np.asarray(values_pairs, dtype=float)

    result_pairs = csr_matrix(
        (values_pairs, j_indices_pairs, indptr_pairs),
        shape=(len(indptr_pairs) - 1, len(vocabulary_pairs)),
        dtype=float,
    )
    result_pairs.sort_indices()
    
    return hstack((normalize(result_pairs), normalize(result_nouns), normalize(result_verbs)))

